import uniqid from "uniqid";
import React from "react";

const Overview = (props) => {
  const { tasks, deleteFunction, editFunction } = { ...props };
  return (
    <div>
      {tasks.map((item) => (
        <div key={uniqid()}>
          <span>
            {item.id}. {item.isEdited?'edited':item.task}
          </span>

          <button onClick={()=>{deleteFunction(item.id)}}>Delet</button>
          <button onClick={()=>{editFunction(item.id)}}>{item.isEdited?'Submit':'Edit'}</button>
        </div>
      ))}
    </div>
  );
};

export default Overview;
